function SpawnVehAfterStart() {
    setTimeout(function(){
        try{
            gm.databaseManager.getConnection().query("SELECT * from vehicles WHERE isSpawned = 'Y'", function (err, res) {
                if (err) console.log("Fehler beim Spawnen von Fahrzeug nach Serverstart: " + err);
                if (res.length > 0){
                    res.forEach(
                        (vehToSpawn) => {
                            if ((vehToSpawn.posX === null && vehToSpawn.posY === null && vehToSpawn.posZ === null) || (vehToSpawn.posX === 0 && vehToSpawn.posY === 0 && vehToSpawn.posZ === 0)){
                                console.log("Fahrzeug " + vehToSpawn.numberplate + " nicht gespawnt (Pos 0,0,0)");
                                gm.databaseManager.getConnection().query("UPDATE vehicles SET isSpawned = 'N' WHERE id = ?", [vehToSpawn.id], function (err, res) {
                                    if (err) console.log(err);
                                });
                            } else {
                                SpawnAfterRestart(vehToSpawn);
                            }
                    });
                    console.log("Fahrzeuge gespawnt");
                }
            });
        } catch (e){
            console.log("ERROR - Garagen - SpawnAfterRestart: " + e);
        }
    }, 5000);
}
SpawnVehAfterStart();

function SpawnAfterRestart(fromDB){
                let vehTuning = JSON.parse(fromDB.tuning);
                let pos = new mp.Vector3(parseInt(fromDB.posX), parseInt(fromDB.posY), parseInt(fromDB.posZ));
                let rot = new mp.Vector3(0, 0, parseInt(fromDB.posRot));
                var veh = mp.vehicles.new(fromDB.modelId, pos, {});
                veh.rotation = rot;
                veh.dimension = 999;
                if ((fromDB.modelId === 2046537925 || fromDB.modelId === 2667966721 || fromDB.modelId === 1912215274 || fromDB.modelId === 4260343491 || fromDB.modelId === 456714581) && fromDB.fraction == "LSPD"){
                    veh.setColorRGB(255,255,255,0,0,0);
                    veh.setVariable("isPolice", "true");
                } else if ((fromDB.modelId === 2321795001 || fromDB.modelId === 3089277354 || fromDB.modelId === 2601952180) && fromDB.fraction == "LSPD"){
                    veh.setColorRGB(0,0,0,0,0,0);
                    veh.setVariable("isPolice", "true");
                } else if ((fromDB.modelId === 1171614426 || fromDB.modelId === 469291905 || fromDB.modelId === 744705981) && fromDB.fraction == "LSMC") {
                    veh.setColorRGB(255,0,0,255,255,255);
                    veh.setVariable("isMedic", "true");
                } else if ((fromDB.modelId === 1127131465 || fromDB.modelId === 2647026068) && fromDB.fraction == "NOOSE") {
                    veh.setColorRGB(0,0,0,0,0,0);
                    //veh.setVariable("isNOOSE", "true");
                } else if ((fromDB.modelId === 3338918751 || fromDB.modelId === 3581397346) && fromDB.fraction == "Cabco") {
                    veh.setColorRGB(255, 153, 0,255, 153, 0);
                    //veh.setVariable("isTaxi", "true");
                    veh.rotation = new mp.Vector3(0, 0, 240);
                } else if ((fromDB.modelId === 142944341 || fromDB.modelId === 3990165190) && fromDB.fraction == "DOJ") {
                    veh.setColorRGB(190,190,190,255,255,255);
                } else {
                    veh.setColor(vehTuning.pcolor, vehTuning.scolor);
                    veh.setVariable("secColor", parseInt(vehTuning.scolor));
                }
                veh.neonEnabled = vehTuning.neonEnabled;
                veh.setNeonColor(parseInt(vehTuning.neonr), parseInt(vehTuning.neong), parseInt(vehTuning.neonb));
                veh.setVariable("neonColorR", parseInt(vehTuning.neonr));
                veh.setVariable("neonColorG", parseInt(vehTuning.neong));
                veh.setVariable("neonColorB", parseInt(vehTuning.neonb));
                veh.setVariable("tuning",String(fromDB.tuning));
                veh.setMod(48, vehTuning.design);
                veh.setMod(0, vehTuning.spoiler);
                veh.setMod(1, vehTuning.front);
                veh.setMod(2, vehTuning.heck);
                veh.setMod(3, vehTuning.seite);
                veh.setMod(4, vehTuning.auspuff);
                veh.setMod(5, vehTuning.rahmen);
                veh.setMod(6, vehTuning.gitter);
                veh.setMod(7, vehTuning.haube);
                veh.setMod(8, vehTuning.kotfl);
                veh.setMod(10, vehTuning.dach);
                veh.setMod(11, vehTuning.motor);
                veh.setMod(12, vehTuning.bremsen);
                veh.setMod(13, vehTuning.getriebe);
                veh.setMod(14, vehTuning.hupe);
                veh.setMod(15, vehTuning.feder);
                veh.setMod(18, vehTuning.turbo);
                veh.setMod(22, vehTuning.xenon);
                if (vehTuning.felgentyp !== undefined) veh.wheelType = vehTuning.felgentyp;
                veh.setMod(23, vehTuning.felgen);
                veh.wheelColor = vehTuning.wheelColor;
                veh.windowTint = vehTuning.windowTint;
                veh.numberPlateType = 1;
                veh.numberPlate = String(fromDB.numberplate);
                veh.engine = false;
                veh.setVariable("isRunning","false");
                veh.setVariable("numberPlate",String(fromDB.numberplate));
                veh.setVariable("fuel",String(fromDB.fuel));
                veh.setVariable("driver",String(fromDB.owner));
                veh.setVariable("vehId",String(fromDB.id));
                veh.setVariable("pearlColor",String(vehTuning.pearlColor));
                veh.setVariable("pcolor",String(vehTuning.pcolor));
                veh.setVariable("owner",String(fromDB.owner));
                veh.setVariable("canStart","true");
                veh.setVariable("misfueled","false");
                veh.locked = true;
                veh.dimension = 0;
                if (gm.vehicleData[""+fromDB.modelId]) {
                  vehData = gm.vehicleData[""+fromDB.modelId];
                  veh.setVariable("tankvolumen",String(vehData.tankvolumen));
                  veh.setVariable("verbrauch",String(vehData.verbrauch));
                  veh.setVariable("treibstoff",String(vehData.treibstoff));
                  veh.setVariable("vehData",JSON.stringify(vehData));
                } else {
                  vehData = gm.vehicleData["undefiniert"];
                  veh.setVariable("tankvolumen",String(vehData.tankvolumen));
                  veh.setVariable("verbrauch",String(vehData.verbrauch));
                  veh.setVariable("treibstoff",String(vehData.treibstoff));
                  veh.setVariable("vehData",JSON.stringify(vehData));
                }
}

mp.events.add("openGarage", (player, id) => {
  if(mp.players.exists(player)) {
    gm.databaseManager.getConnection().query("SELECT * FROM garages WHERE actionId = ?", [id], function (err, res) {
        if (err) console.log(err);
        if (!res.length > 0) {
            // Fehler beim Laden der Garage - keine Ergebnisse aus DB
            player.notify("~r~Parkwächter: \"Ich habe gerade Feierabend!\"");
            return;
        }
        let garage = res[0];
        const garagenType = garage.type;
        const garagenId = garage.id;
        const garagenFraktion = garage.fraktion;
        const pos = new mp.Vector3(garage.spawnerX, garage.spawnerY, garage.spawnerZ);
            // Prüfe, ob ein Spawner gesetzt wurde
        if (garage.spawnerX === 0 || garage.spawnerY === 0 || garage.spawnerZ === 0) {
            player.notify("~r~Parkwächter: \"Die Garage hat momentan technische Probleme!\"");
            console.log("Garage " + garagenId + "hat keinen Spawner!");
            return;
        }

            // Prüfe, ob der Spieler zur Fraktion gehört
        if (garagenFraktion != "none") {
            if (player.data.fraktion != garagenFraktion) {
                player.notify("~r~Parkwächter: \"Diese Garage ist nur für berechtigte Mitarbeiter zugänglich!\"");
                return;
            }
        }

        player.setVariable('currentGarage', garagenId);
            // Fahrzeuge aus Datenbank holen und Garagenmenu öffnen - TODO: DB Abfrage
        gm.databaseManager.getConnection().query("SELECT * FROM garages WHERE actionId = ?", [id], function (err, res) {
            if (err) console.log(err);
            gm.databaseManager.getConnection().query("SELECT DISTINCT vehicles.* FROM vehicles LEFT JOIN vehicleKeys ON vehicleKeys.vehID = vehicles.id WHERE (vehicles.owner = ? OR vehicleKeys.keyOwner = ? AND vehicleKeys.isActive = 'Y') AND vehicles.isSpawned = 'N' AND vehicles.isImpounded = 'N' AND vehicles.garage = ? ORDER BY vehicles.numberplate", [player.data.internalId, player.data.internalId, garagenId], function (err, res) {
                if (err) console.log(err);
                if (res.length > 0){
                    let VehList = [];
                    var i = 1;
                    res.forEach(function (vehfraction) {
                      if(mp.players.exists(player)) {
                        if (vehfraction.fraction !== "none") {
                          var fractionData = player.data.fractionData;
                          fractionData = JSON.parse(fractionData);
                          var businessData = player.data.businessData;
                          businessData = JSON.parse(businessData);
                          let isAccepted = false;
                          if (vehfraction.fraction === "LSPD" && fractionData.fractionName == "LSPD" && fractionData.playerFractionDuty == "Y") isAccepted = true;
                          if (vehfraction.fraction === "LSMC" && fractionData.fractionName == "LSMC" && fractionData.playerFractionDuty == "Y") isAccepted = true;
                          if (vehfraction.fraction === "NOOSE" && fractionData.fractionName == "NOOSE" && fractionData.playerFractionDuty == "Y") isAccepted = true;
                          if (vehfraction.fraction === "Cabco" && fractionData.fractionName == "Downtown Cab Co." && fractionData.playerFractionDuty == "Y") isAccepted = true;
                          if (vehfraction.fraction === "DOJ" && fractionData.fractionName == "Department of Justice" && fractionData.playerFractionDuty == "Y") isAccepted = true;
                          if (vehfraction.fraction === "LSC" && businessData.businessName == "Los Santos Customs" && businessData.playerBusinessDuty == "Y") isAccepted = true;
                          if (vehfraction.fraction === "LSM" && businessData.businessName == "Los Santos Meteor" && businessData.playerBusinessDuty == "Y") isAccepted = true;
                          if (vehfraction.fraction === "Bennys" && businessData.businessName == "Bennys Werkstatt" && businessData.playerBusinessDuty == "Y") isAccepted = true;
                          if (vehfraction.fraction === "Beekers" && businessData.businessName == "Beekers Garage & Part" && businessData.playerBusinessDuty == "Y") isAccepted = true;

                          if(isAccepted == true) {
                            if (gm.vehicleData[""+vehfraction.modelId]) {
                							vehData = gm.vehicleData[""+vehfraction.modelId];
                						} else {
                							vehData = gm.vehicleData["undefiniert"];
                						}
                            let obj = {"owner": vehfraction.owner, "model": String(vehfraction.modelId), "bezeichnung": String(vehData.bezeichnung), "kennzeichen": String(vehfraction.numberplate)};
                            VehList.push(obj);
                          }
                        } else {
                          if (gm.vehicleData[""+vehfraction.modelId]) {
                            vehData = gm.vehicleData[""+vehfraction.modelId];
                          } else {
                            vehData = gm.vehicleData["undefiniert"];
                          }
                          let obj = {"owner": vehfraction.owner, "model": String(vehfraction.modelId), "bezeichnung": String(vehData.bezeichnung), "kennzeichen": String(vehfraction.numberplate)};
                          VehList.push(obj);
                        }

                        if (parseInt(i) == parseInt(res.length)) {
                            if (VehList.length == 0) player.call("client:Garagen:drawMenu", ["none"]);
                            let listForClient = [];
                            let ownVehicles = [];
                            let otherVehicles = [];
                            VehList.forEach((v) => {
                                if (v.owner === player.data.internalId){
                                    ownVehicles.push(v);
                                } else {
                                    otherVehicles.push(v);
                                }
                            });
                            listForClient = ownVehicles.concat(otherVehicles);
                            player.call("client:Garagen:drawMenu", [JSON.stringify(listForClient)]);
                        }

                        i++;
                      }
                    });
                } else{
                    player.call("client:Garagen:drawMenu", ["none"]);
                }
            });
        });
    });
  }
});

function spawnVeh(player, numplate) {
  if(mp.players.exists(player)) {
    gm.databaseManager.getConnection().query("SELECT * FROM garages WHERE id = ?", [player.getVariable("currentGarage")], function (err, res) {
        if (err) console.log(err);

        if (!res.length > 0) {
            player.notify("~r~Es ist ein Fehler aufgetreten!");
            return;
        }

        garage = res[0];
        const pos = new mp.Vector3(garage.spawnerX, garage.spawnerY, garage.spawnerZ);

        if (getVehicleFromPosition(pos, 3).length > 0) {
            player.notify("~r~Es steht bereits ein Fahrzeug in der Ausfahrt");
            return;
        }
                    //"SELECT vehicles.*, vehicleKeys.* FROM vehicles LEFT JOIN vehicleKeys ON vehicleKeys.vehID = vehicles.id WHERE (vehicles.owner = ? OR vehicleKeys.keyOwner = ?) AND vehicles.isSpawned = 'N' AND vehicles.isImpounded = 'N' AND vehicles.garage = ? ORDER BY vehicles.numberplate"
        //gm.databaseManager.getConnection().query("SELECT * FROM vehicles WHERE owner = ? AND isSpawned = 'N' AND numberplate = ?", [player.data.internalId, numplate], function (err, res) {
        gm.databaseManager.getConnection().query("SELECT DISTINCT vehicles.*, vehicleKeys.keyOwner FROM vehicles LEFT JOIN vehicleKeys ON vehicleKeys.vehID = vehicles.id WHERE (vehicles.`owner` = ? OR vehicleKeys.keyOwner = ? AND vehicleKeys.isActive = 'Y') AND vehicles.isSpawned = 'N' AND vehicles.isImpounded = 'N' AND vehicles.numberplate = ?", [player.data.internalId, player.data.internalId, numplate], function (err, res) {
            if (err) console.log(err);
            if (res.length > 0){
              if(mp.players.exists(player)) {
                let fromDB = res[0];
                let vehTuning = JSON.parse(fromDB.tuning);
                var veh = mp.vehicles.new(fromDB.modelId, pos, {});
                veh.dimension = 999;
                if ((fromDB.modelId === 2046537925 || fromDB.modelId === 2667966721 || fromDB.modelId === 1912215274 || fromDB.modelId === 4260343491 || fromDB.modelId === 456714581) && fromDB.fraction == "LSPD"){
                    veh.setColorRGB(255,255,255,0,0,0);
                    veh.setVariable("isPolice", "true");
                } else if ((fromDB.modelId === 2321795001 || fromDB.modelId === 3089277354 || fromDB.modelId === 2601952180) && fromDB.fraction == "LSPD"){
                    veh.setColorRGB(0,0,0,0,0,0);
                    veh.setVariable("isPolice", "true");
                } else if ((fromDB.modelId === 1171614426 || fromDB.modelId === 469291905 || fromDB.modelId === 744705981) && fromDB.fraction == "LSMC") {
                    veh.setColorRGB(255,0,0,255,255,255);
                    veh.setVariable("isMedic", "true");
                } else if ((fromDB.modelId === 1127131465 || fromDB.modelId === 2647026068) && fromDB.fraction == "NOOSE") {
                    veh.setColorRGB(0,0,0,0,0,0);
                    //veh.setVariable("isNOOSE", "true");
                    veh.rotation = new mp.Vector3(0, 0, 159);
                } else if ((fromDB.modelId === 3338918751 || fromDB.modelId === 3581397346) && fromDB.fraction == "Cabco") {
                    veh.setColorRGB(255, 153, 0,255, 153, 0);
                    //veh.setVariable("isTaxi", "true");
                    veh.rotation = new mp.Vector3(0, 0, 240);
                } else if ((fromDB.modelId === 1941029835 || fromDB.modelId === 3874056184 || fromDB.modelId === Cognoscenti || fromDB.modelId === 2333339779) && fromDB.fraction == "Cabco") {
                    veh.rotation = new mp.Vector3(0, 0, 240);
                    //veh.setVariable("isTaxi", "true");
                } else if ((fromDB.modelId === 142944341 || fromDB.modelId === 3990165190) && fromDB.fraction == "DOJ") {
                    veh.setColorRGB(190,190,190,255,255,255);
                } else {
                    veh.setColor(vehTuning.pcolor, vehTuning.scolor);
                    veh.setVariable("secColor", parseInt(vehTuning.scolor));
                }
                veh.neonEnabled = vehTuning.neonEnabled;
                veh.setNeonColor(parseInt(vehTuning.neonr), parseInt(vehTuning.neong), parseInt(vehTuning.neonb));
                veh.setVariable("neonColorR", parseInt(vehTuning.neonr));
                veh.setVariable("neonColorG", parseInt(vehTuning.neong));
                veh.setVariable("neonColorB", parseInt(vehTuning.neonb));
                veh.setVariable("tuning",String(fromDB.tuning));
                veh.setMod(48, vehTuning.design);
                veh.setMod(0, vehTuning.spoiler);
                veh.setMod(1, vehTuning.front);
                veh.setMod(2, vehTuning.heck);
                veh.setMod(3, vehTuning.seite);
                veh.setMod(4, vehTuning.auspuff);
                veh.setMod(5, vehTuning.rahmen);
                veh.setMod(6, vehTuning.gitter);
                veh.setMod(7, vehTuning.haube);
                veh.setMod(8, vehTuning.kotfl);
                veh.setMod(10, vehTuning.dach);
                veh.setMod(11, vehTuning.motor);
                veh.setMod(12, vehTuning.bremsen);
                veh.setMod(13, vehTuning.getriebe);
                veh.setMod(14, vehTuning.hupe);
                veh.setMod(15, vehTuning.feder);
                veh.setMod(18, vehTuning.turbo);
                veh.setMod(22, vehTuning.xenon);
                if (vehTuning.felgentyp !== undefined) veh.wheelType = vehTuning.felgentyp;
                veh.setMod(23, vehTuning.felgen);
                veh.wheelColor = vehTuning.wheelColor;
                veh.windowTint = vehTuning.windowTint;
                veh.numberPlateType = 1;
                veh.numberPlate = String(fromDB.numberplate);
                veh.engine = true;
                veh.setVariable("isRunning","true");
                veh.setVariable("numberPlate",String(fromDB.numberplate));
                veh.setVariable("fuel",String(fromDB.fuel));
                veh.setVariable("driver",String(player.id));
                veh.setVariable("vehId",String(fromDB.id));
                veh.setVariable("pearlColor",String(vehTuning.pearlColor));
                veh.setVariable("pcolor",String(vehTuning.pcolor));
                veh.setVariable("owner",String(fromDB.owner));
                veh.setVariable("canStart","true");
                veh.setVariable("misfueled","false");
                veh.locked = true;
                //player.call("modpearl", [veh, parseInt(vehTuning.pearl1), veh.getColor(0)]);
                veh.dimension = player.dimension;
                player.notify("~g~Fahrzeug ~y~" + fromDB.numberplate + " ~g~ausgeparkt");
                if (gm.vehicleData[""+fromDB.modelId]) {
                  vehData = gm.vehicleData[""+fromDB.modelId];
                  veh.setVariable("tankvolumen",String(vehData.tankvolumen));
                  veh.setVariable("verbrauch",String(vehData.verbrauch));
                  veh.setVariable("treibstoff",String(vehData.treibstoff));
                  veh.setVariable("vehData",JSON.stringify(vehData));
                } else {
                  vehData = gm.vehicleData["undefiniert"];
                  veh.setVariable("tankvolumen",String(vehData.tankvolumen));
                  veh.setVariable("verbrauch",String(vehData.verbrauch));
                  veh.setVariable("treibstoff",String(vehData.treibstoff));
                  veh.setVariable("vehData",JSON.stringify(vehData));
                }
                gm.databaseManager.getConnection().query("UPDATE vehicles SET isSpawned = 'Y' WHERE id = ?", [fromDB.id], function (err, res) {
                    if (err) console.log(err);
                });
              }
            }
        });
    });
  }
}
mp.events.add("server:Garagen:spawnVeh", spawnVeh);

function destroyVeh(player) {
  if(mp.players.exists(player)) {
    gm.databaseManager.getConnection().query("SELECT * FROM garages WHERE id = ?", [player.getVariable("currentGarage")], function (err, res) {
        if (err) console.log(err);

        if (!res.length > 0) {
            player.notify("~r~Es ist ein Fehler aufgetreten!");
            return;
        }

        garage = res[0];
        const pos = new mp.Vector3(garage.spawnerX, garage.spawnerY, garage.spawnerZ);
        const veh = getVehicleFromPosition(pos, 2)[0];

        if (mp.vehicles.exists(veh)) {
        if (veh === null) {
            player.notify("~r~Kein Fahrzeug in der Einfahrt");
            return;
        }

        gm.databaseManager.getConnection().query("SELECT vehicles.*, vehicleKeys.keyOwner FROM vehicles LEFT JOIN vehicleKeys ON vehicleKeys.vehID = vehicles.id WHERE (vehicles.owner = ? OR vehicleKeys.keyOwner = ? AND vehicleKeys.isActive = 'Y') AND vehicles.isSpawned = 'Y' AND vehicles.isImpounded = 'N' AND vehicles.numberplate = ?", [player.data.internalId, player.data.internalId, veh.numberPlate], function (err, res) {
            if(err) console.log(err);

            player.notify("Count: "+res.length);

            if(res.length == 0) {
                player.notify("~r~Dir gehört das Fahrzeug nicht oder hat ein falsches Kennzeichen!");
                return;
            }

            let vehTuning = {
                pcolor: veh.getColor(0),
                scolor: veh.getVariable("secColor"),
                neonr: parseInt(veh.getVariable("neonColorR")),
                neong: parseInt(veh.getVariable("neonColorG")),
                neonb: parseInt(veh.getVariable("neonColorB")),
                neonEnabled: veh.neonEnabled,
                wheelColor: veh.wheelColor,
                windowTint: veh.windowTint,
                design: veh.getMod(48),
                spoiler: veh.getMod(0),
                front: veh.getMod(1),
                heck: veh.getMod(2),
                seite: veh.getMod(3),
                auspuff: veh.getMod(4),
                rahmen: veh.getMod(5),
                gitter: veh.getMod(6),
                haube: veh.getMod(7),
                kotfl: veh.getMod(8),
                dach: veh.getMod(10),
                motor: veh.getMod(11),
                bremsen: veh.getMod(12),
                getriebe: veh.getMod(13),
                hupe: veh.getMod(14),
                feder: veh.getMod(15),
                turbo: veh.getMod(18),
                xenon: veh.getMod(22),
                felgen: veh.getMod(23),
                felgentyp: veh.wheelType,
                pearlColor: parseInt(veh.getVariable("pearlColor")),
            }

            let fuel = veh.getVariable("fuel");

            gm.databaseManager.getConnection().query("UPDATE vehicles SET isSpawned = 'N' , garage = ? , tuning = ?, fuel = ? WHERE numberplate = ?", [player.getVariable("currentGarage"), JSON.stringify(vehTuning), fuel, veh.numberPlate], function (err, res) {
                if (err) console.log(err);

                player.notify("~g~Du hast das Fahrzeug eingeparkt!");
                if (veh) {
                  veh.destroy();
                }
            });
        });
      }
    });
  }
}
mp.events.add("server:Garagen:destroyVeh", destroyVeh);

function getVehicleFromPosition(position, range) {
    const returnVehicles = [];

    mp.vehicles.forEachInRange(position, range,
        (vehicle) => {
            returnVehicles.push(vehicle);
        }
    );
    return returnVehicles;
}
